from time import time


def sort(arr):
    

    for _ in range(len(arr)-1):
        for k in range(len(arr) - 1 - _ ):
            if arr[k]> arr[k+1]:
                
                arr[k],arr[k+1] = arr[k+1],arr[k]
                '''temp=arr[k]
                arr[k]=arr[k+1]
                arr[k+1]=temp'''
                
    return arr




